const generalAllocationStatus = [];
const generalAllocationStatusByMonth = [];
const TODAY = new Date();
const general = [];

const google = {
  script: {
    run: {
      withSuccessHandler: (callback) => {
        return ({
          getValueByField: (field, value) => {
            return callback(MOCK_COLABS.find(e => e[field] == value));
          },
          getColaborators: () => {
            return callback(MOCK_COLABS)
          },
          getProjectsCDM: () => {
            return callback(MOCK_PROJETOS_CDM)
          },
          getProjectsICS: () => {
            return callback(MOCK_PROJETOS_ICS)
          },
          getAllocationCDM: () => {
            return callback(MOCK_ALOCACAO_CDM);
          },
          getAllocationICS: () => {
            return callback(MOCK_ALOCACAO_ICS);
          },
          getCurrentAllocationCDM: () => {
            if(generalAllocationStatus.length > 0) return callback(generalAllocationStatus);
            // let fullAllocationInfo = getFullAllocationInfo();
            let fullAllocationInfo = MOCK_ALOCACAO_CDM.map((element) => ({
              ...element,
              Centro: 'CDM',
            }));

            fullAllocationInfo.forEach((item) => {
              if(item["Data de Fim"] !== '' && item["Data de Fim"] !== undefined && item["Data de Início"] !== '' && 
              item["Data de Início"] !== undefined && item.Projeto !== '') {

                const endProjectDate = new Date(item["Data de Fim"]);
                const initialProjectDate = new Date(item["Data de Início"]);
  
                const existingItem = generalAllocationStatus.find( (a) =>
                  a.Colaborador === item.Colaborador
                );
  
                const isProjectValid = endProjectDate.getTime()  > TODAY.getTime() && initialProjectDate.getTime() < TODAY.getTime();
                const percentageAllocated = isProjectValid ? item["Tempo dedicado"] : 0;
  
                if (existingItem !== undefined && !existingItem.allocated) {
                  existingItem.percentageAllocated += percentageAllocated;
                  existingItem.allocated =  existingItem.percentageAllocated >= 1;
                } 
                else if(existingItem === undefined) {
                  generalAllocationStatus.push({
                    ...item,
                    allocated: percentageAllocated >= 1,
                    percentageAllocated,
                  });
                }
              }
              else {
                generalAllocationStatus.push({
                  ...item,
                  allocated: false,
                  percentageAllocated: 0,
                });
              }

            });
            return callback(generalAllocationStatus);
          },
          getCurrentAllocatedWorkersByMonth: (year) => {
            if(generalAllocationStatusByMonth.length > 0) return callback(generalAllocationStatusByMonth);
            let fullAllocationInfo = getFullAllocationInfo();

            const monthDays = []
            for (let i = 0; i < 12 ; i+=1) {
              const firstDay = new Date(year, i, 1)
              const lastDay = new Date(year, i+1, 0)
              monthDays.push({
                begin: firstDay.getTime(),
                end: lastDay.getTime()
              });
            }

            monthDays.forEach((month, index) => {
              const allocatedThisMonth = [];
              fullAllocationInfo.forEach((item) => {
                if(item["Data de Fim"] !== '' && item["Data de Fim"] !== undefined && item["Data de Início"] !== '' && 
                item["Data de Início"] !== undefined && item.Projeto !== '') {
                  
                  const initialProjectDate = new Date(item["Data de Início"]);
                  const endProjectDate = new Date(item["Data de Fim"]);
    
                  const existingItem = allocatedThisMonth.find( (a) =>
                    a.Colaborador === item.Colaborador
                  );
  
                  const isProjectValid = initialProjectDate.getTime() < month.end && endProjectDate.getMonth() >= index;
                  const percentageAllocated = isProjectValid ? item["Tempo dedicado"] : 0;
  
                  if (existingItem !== undefined && !existingItem.allocated) {
                    existingItem.percentageAllocated += percentageAllocated;
                    existingItem.allocated =  existingItem.percentageAllocated >= 1;
                    existingItem["Data de Início"] = item["Data de Início"]
                    existingItem["Data de Fim"] = item["Data de Fim"]
                  } 
                  else if(existingItem === undefined) {
                    allocatedThisMonth.push({
                      ...item,
                      allocated: percentageAllocated >= 1,
                      percentageAllocated,
                    });
                  }
                }
                else {
                  allocatedThisMonth.push({
                    ...item,
                    allocated: false,
                    percentageAllocated: 0,
                  });
                }
              });
              generalAllocationStatusByMonth.push(allocatedThisMonth);
            });

            return callback(generalAllocationStatusByMonth);
          },
          getGeneralAllocationOverview: () => {
            if(general.length > 0) return callback(general);
            let fullAllocationInfo = getFullAllocationInfo();
            let filtered = [];

            MOCK_COLABS.forEach((colab) => {
              filtered = fullAllocationInfo.filter((i) => i.Sigla === colab.Sigla );
              general.push({
                Nome: colab.Nome,
                Sigla: colab.Sigla,
                Area: colab["Área"],
                Centro: colab["Centro"],
                AlocacaoPercentage: filtered.map((i) => {
                  const initialProjectDate = new Date(i["Data de Início"]);
                  const endProjectDate = new Date(i["Data de Fim"]);
                  if(initialProjectDate.getTime() < TODAY.getTime() && endProjectDate.getTime() > TODAY.getTime()){
                    return i["Tempo dedicado"];
                  }
                  else return 0;
                }).reduce((pv, cv) => pv + cv, 0),
                Janeiro: resolve_month(filtered, 0, 2023),
                Fevereiro: resolve_month(filtered, 1, 2023),
                Marco: resolve_month(filtered, 2, 2023),
                Abril: resolve_month(filtered, 3, 2023),
                Maio: resolve_month(filtered, 4, 2023),
                Junho: resolve_month(filtered, 5, 2023),
                Julho: resolve_month(filtered, 6, 2023),
                Agosto: resolve_month(filtered, 7, 2023),
                Setembro: resolve_month(filtered, 8, 2023),
                Outubro: resolve_month(filtered, 9, 2023),
                Novembro: resolve_month(filtered, 10, 2023),
                Dezembro: resolve_month(filtered, 11, 2023),
              });
            });
            
            return callback(general);
          }
        })
      }
    }
  }
}

function getFullAllocationInfo() {
  const fullAllocationInfo = [];
  const totalAllocation = [...MOCK_ALOCACAO_CDM, ...MOCK_ALOCACAO_ICS]
  totalAllocation.sort(function (a, b) {
    if (a.Sigla < b.Sigla) {
      return -1;
    }
    if (a.Sigla > b.Sigla) {
      return 1;
    }
    return 0;
  });
  
  totalAllocation.forEach((element) => {
    let colab = MOCK_COLABS.find((i) => i.Sigla === element.Sigla);
    fullAllocationInfo.push({
      ...element,
      Centro: colab.Centro,
    });
  });
  
  return fullAllocationInfo;
}

function resolve_month(data, month, year){
  return data.filter((i) => {
    const lastDay = new Date(year, month+1, 0)
    const initialProjectDate = new Date(i["Data de Início"]);
    const endProjectDate = new Date(i["Data de Fim"]);

    return initialProjectDate.getTime() < lastDay.getTime() && endProjectDate.getMonth() >= month
    
  }).map((j) => j.Projeto).reduce((pv, cv) => `${pv}${cv}, `, '').slice(0, -2);
}